export class Reservation {
  constructor(id, date, billed, accessEvent, accessDate, tdTxId, transactionId, ticket, user, event) {
    this.id = id;
    this.date = date;
    this.billed = billed;
    this.accessEvent = accessEvent;
    this.accessDate = accessDate;
    this.tdTxId = tdTxId;
    this.transactionId = transactionId;
    this.ticket = ticket;
    this.user = user;
    this.event = event;
    this.billed = this.billed ?? false;
    this.accessEvent = this.accessEvent ?? false;
  }
}
export function getReservationIdentifier(reservation) {
  return reservation.id;
}
